import React, { useEffect, useState } from 'react'
import '../styles.css'
import EventIcon from '@mui/icons-material/Event'
import EventAvailableIcon from '@mui/icons-material/EventAvailable'
import EventBusyIcon from '@mui/icons-material/EventBusy'
import { fetchStaticAllExperiencesFromAPI } from '../../api/StaticData'
import BoxPlot from '../charts/BoxPlot'
import StaticSunBurst from '../buildCharts/sunBurstChart/StaticSunBurst'
import StaticWordCloud from '../buildCharts/wordCloudChart/StaticWordCloud'
import StaticBoxPlot from '../buildCharts/boxPlotChart/StaticBoxPlot'
import WordCloud from '../charts/WordCloud'
import StaticTimeLine from '../buildCharts/timeLineChart/StaticTimeLine'
import StaticStackedBar from '../buildCharts/stackedBarChart/StaticStackedBar'

const OverviewPage = () => {
  const [boxPlotData, setBoxPlotData] = useState({})
  const [wordCloudData, setWordCloudData] = useState({})
  const [timeLineData, setTimeLineData] = useState({})
  const [sunburstData, setSunburstData] = useState({})
  const [eventTypeColor, setEventTypeColor] = useState({})
  const [expData, setExpData] = useState([])

  const handleDataReceived = (data) => {
    setBoxPlotData(data)
  }

  const handleWordDataReceived = (data) => {
    setWordCloudData(data)
  }

  const handleTimeLineDataReceived = (data) => {
    setTimeLineData(data)
  }

  const handelEventTypeColor = (data) => {
    setEventTypeColor(data)
  }

  const handelSunburstDataReceived = (data) => {
    setSunburstData(data)
  }

  console.log('onE', sunburstData)
  useEffect(() => {
    const fetchExpData = async () => {
      try {
        const fetchedData = await fetchStaticAllExperiencesFromAPI()
        setExpData(fetchedData)
      } catch (error) {
        console.error('Error fetching word cloud data:', error)
      }
    }

    fetchExpData()
  }, [])

  return (
    <div className="container-fluid" style={{ paddingTop: '20px' }}>
      <div className="row">
        <div className="col-md-8">
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#a6bddb',
            }}
          >
            {timeLineData.length > 0 ? (
              <StaticTimeLine
                data={timeLineData}
                onDataReceived={handleDataReceived}
                onWordDataReceived={handleWordDataReceived}
                onExpLabelReceived={onExpLabelReceived}
                onExpDataReceived={handelSunburstDataReceived}
                onEventTypeColor={eventTypeColor}
              />
            ) : (
              <StaticTimeLine
                onEventTypeColor={eventTypeColor}
                onDataReceived={handleDataReceived}
                onExpLabelReceived={onExpLabelReceived}
                onExpDataReceived={handelSunburstDataReceived}
                onWordDataReceived={handleWordDataReceived}
              />
            )}
          </div>
        </div>
        <div
          className="col-md-4"
          style={{ display: 'flex', justifyContent: 'flex-end' }}
        >
          <div className="flex-column">
            <div className="d-flex justify-content-between">
              <div
                className="first-div"
                style={{
                  height: '200px',
                  width: '200px',
                  padding: '30px',
                  marginInline: '10px',
                  marginBottom: '20px',
                  background: '#a6bddb',
                }}
              >
                <h2
                  style={{
                    fontFamily: 'Arial, sans-serif',
                    fontSize: '24px',
                    fontWeight: 'bold',
                    color: '#333',
                    marginBottom: '10px',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  Total Experiences
                </h2>
                <div
                  style={{
                    border: '2px solid black',
                    borderRadius: '10px',
                    padding: '10px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  <EventIcon
                    fontSize={'large'}
                    style={{ marginRight: '10px' }}
                  />
                  {expData && <h3>{expData.total_experiences}</h3>}
                </div>
              </div>
              <div
                className="first-div"
                style={{
                  height: '200px',
                  width: '200px',
                  padding: '30px',
                  marginInline: '10px',
                  marginBottom: '20px',
                  background: '#a6bddb',
                }}
              >
                <h2
                  style={{
                    fontFamily: 'Arial, sans-serif',
                    fontSize: '24px',
                    fontWeight: 'bold',
                    color: '#333',
                    marginBottom: '10px',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  Successful Experiences
                </h2>
                <div
                  style={{
                    border: '2px solid black',
                    borderRadius: '10px',
                    padding: '10px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  <EventAvailableIcon
                    fontSize={'large'}
                    style={{ marginRight: '10px' }}
                  />
                  {expData && <h3>{expData.successful_experiences}</h3>}
                </div>
              </div>
              <div
                className="first-div"
                style={{
                  height: '200px',
                  width: '200px',
                  padding: '30px',
                  marginInline: '10px',
                  marginBottom: '20px',
                  background: '#a6bddb',
                }}
              >
                <h2
                  style={{
                    fontFamily: 'Arial, sans-serif',
                    fontSize: '24px',
                    fontWeight: 'bold',
                    color: '#333',
                    marginBottom: '10px',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  Error Experiences
                </h2>
                <div
                  style={{
                    border: '2px solid black',
                    borderRadius: '10px',
                    padding: '10px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  <EventBusyIcon
                    fontSize={'large'}
                    style={{ marginRight: '10px' }}
                  />
                  {expData && <h3>{expData.error_experiences}</h3>}
                </div>
              </div>
            </div>
            <div
              className="first-div"
              style={{
                width: '100%',
                background: '#a6bddb',
                alignItems: 'center',
                justifyContent: 'center',
                textAlign: 'center',
                height: '200px',
                marginTop: '20px',
              }}
            >
              <h2>
                Pensar o que poderei colocar aqui! Talvez informação dos
                participantes!
              </h2>
            </div>
          </div>
        </div>
      </div>
      <div
        className="row"
        style={{ display: 'flex', justifyContent: 'center' }}
      >
        <div className="col-md-4">
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#a6bddb',
            }}
          >
            <h2
              style={{
                fontFamily: 'Arial, sans-serif',
                fontSize: '24px',
                fontWeight: 'bold',
                color: '#333',
                marginBottom: '10px',
              }}
            >
              In-Depth Data Analysis
            </h2>
            {sunburstData ? (
              <StaticSunBurst
                label={sunburstData}
                onDataReceived={handleDataReceived}
                onWordDataReceived={handleWordDataReceived}
                onTimeLineDataReceived={handleTimeLineDataReceived}
                onEventTypeColor={handelEventTypeColor}
              />
            ) : (
              <StaticSunBurst
                onDataReceived={handleDataReceived}
                onWordDataReceived={handleWordDataReceived}
                onTimeLineDataReceived={handleTimeLineDataReceived}
                onEventTypeColor={handelEventTypeColor}
              />
            )}
          </div>
        </div>
        <div className="col-md-4">
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#a6bddb',
            }}
          >
            <h2
              style={{
                fontFamily: 'Arial, sans-serif',
                fontSize: '24px',
                fontWeight: 'bold',
                color: '#333',
                marginBottom: '10px',
              }}
            >
              Data Distribution
            </h2>
            {boxPlotData.length > 0 ? (
              <BoxPlot data={boxPlotData} />
            ) : (
              <StaticBoxPlot />
            )}
          </div>
        </div>
        <div className="col-md-4">
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#a6bddb',
            }}
          >
            <h2
              style={{
                fontFamily: 'Arial, sans-serif',
                fontSize: '24px',
                fontWeight: 'bold',
                color: '#333',
                marginBottom: '10px',
              }}
            >
              Word Distribution
            </h2>
            {wordCloudData.length > 0 ? (
              <WordCloud data={wordCloudData} />
            ) : (
              <StaticWordCloud />
            )}
          </div>
        </div>
      </div>
      <div
        className="row"
        style={{ display: 'flex', justifyContent: 'center' }}
      >
        <div className="col-md-6">
          <div className="section" style={{ height: '500px', padding: '30px' }}>
            <StaticStackedBar />
          </div>
        </div>
      </div>
    </div>
  )
}

export default OverviewPage
